import React from 'react'
import ReactDOM from 'react-dom'
import Cards from './components/Cards'
import 'bootstrap/dist/css/bootstrap.min.css'
import axios from 'axios'

const container = document.getElementById('root')

function takeCur(){
    axios.get('https://free.currconv.com/api/v7/convert?apiKey=do-not-use-this-key&q=EUR_ARS,USD_ARS')
  .then(function (response) {
    let EURtoARS = response.data.results.EUR_ARS.val;
    let USDtoARS = response.data.results.USD_ARS.val;
    console.log(EURtoARS+' -- '+USDtoARS);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  });
}
takeCur();

ReactDOM.render(<Cards
                dolarARS={USDtoARS}
                euroARS={EURtoARS}
                 />,container)
